import React from 'react';
import { IoMenuSharp } from "react-icons/io5";

const Nav = () => {
  return (
    <div className='w-full'>
      <div className='fixed z-[999] max-w-screen-2xl mx-auto px-5 sm:px-10 py-5 sm:py-10 flex items-center justify-between text-white'>
        <div className='logo'>
          <div className="wordmark" data-v-1932cced="">
            <svg viewBox="0 0 95 25" fill="none" xmlns="http://www.w3.org/2000/svg" className='w-20' data-v-1932cced="">
              {/* SVG Path Data */}
            </svg>
          </div>
        </div>
        <div className='links hidden sm:flex gap-10'>
          {["Home", "About", "Pricing", "Contact"].map((item, index) => 
            <a key={index} className="text-sm font-light font-sans">{item}</a>
          )}
        </div>
        <span className='sm:hidden'>
          <IoMenuSharp />
        </span>
      </div>
    </div>
  );
}

export default Nav;
